export async function loader({ request }: DataFunctionArgs) {
  const userSession = await authenticator.isAuthenticated(request, {
    failureRedirect: "/login",
  });
  const user = await model.user.query.getForSession({ id: userSession.id });
  const userId = user?.id
  const dataPDF = await getDailyPDF(userId)
  console.log(user)
  return json({ ok: true, dataPDF, user })
}

export default function DailySheet({ dataPDF }) {
  const { user } = useLoaderData()
  console.log(dataPDF, user)
  const today = new Date();
  today.setDate(today.getDate())
  const options = {
    month: 'short',   // abbreviated month name
    day: '2-digit',   // 2-digit day
    year: 'numeric',  // 4-digit year
    weekday: 'short',  // abbreviated weekday name
    hour: '2-digit',  // 2-digit hour (0-23)
    minute: '2-digit', // 2-digit minute
  };
  const todaysDate = today.toLocaleString('en-US', options);

  const Click = () => {
    const doc = new jsPDF()

    const img = "data:image/jpg;base64,"

    var width = doc.internal.pageSize.getWidth()
    var height = doc.internal.pageSize.getHeight()
    doc.addImage(img, 'JPEG', 0, 0, width, height)
    doc.setFontSize(9)
    doc.text(56, 56, `${user.username}`)
    doc.text(145, 55, `${todaysDate}`)

    doc.text(83, 88, `${dataPDF.todaysGoalGuest}`)
    doc.text(108, 88, `${dataPDF.todaysActualGuest}`)
    doc.text(132, 88, `${dataPDF.differenceGuest}`)
    doc.text(157, 88, `${dataPDF.monthsGoalGuest}`)

    doc.text(83, 98, `${dataPDF.todaysGoalTestDrives}`)
    doc.text(108, 98, `${dataPDF.todaysActualTestDrives}`)
    doc.text(132, 98, `${dataPDF.differenceTestDrives}`)
    doc.text(157, 98, `${dataPDF.monthsGoalTestDrives}`)

    doc.text(83, 108, `${dataPDF.todaysGoalWriteUps}`)
    doc.text(108, 108, `${dataPDF.todaysActualWriteUps}`)
    doc.text(132, 108, `${dataPDF.differenceWriteUps}`)
    doc.text(157, 108, `${dataPDF.monthsGoalWriteUps}`)

    doc.text(83, 118, `${dataPDF.todaysGoalDeliveries}`)
    doc.text(108, 118, `${dataPDF.todaysActualDeliveries}`)
    doc.text(132, 118, `${dataPDF.differenceDeliveries}`)
    doc.text(157, 118, `${dataPDF.monthsGoalDeliveries}`)



    doc.text(35, 153, 'Ask questions, select the right bike, go for the close to see where in the sales process they are at,')
    doc.text(35, 162, 'sit on and present features and benefites, offer test drive, trial close: sit down and write up,')
    doc.text(35, 173, 'negotiate, handle objections, obtain commitment in some way or form, turn over to finance')

    doc.text(35, 208, 'follow up with todays tasks in crm')
    doc.text(35, 219, 'ensure all listings on socials are up to date')
    doc.text(35, 229, 'complete appts or reschedule if they were no shows')
    doc.text(35, 240, 'have sit down with SM to discuss sales oppurtunities that may be missed')


    doc.addPage('letter')
    var width2 = doc.internal.pageSize.getWidth()
    var height2 = doc.internal.pageSize.getHeight()
    const img2 = "data:image/jpg;base64,"
    doc.addImage(img2, 'JPEG', 0, 0, width2, height2)


    doc.save(`dailyWorkPlan.pdf`)
  }
  return (
    <>
      <Button onClick={Click} className="bg-primary w-[75px] mx-1 text-foreground active:bg-black font-bold uppercase   text-xs  rounded shadow hover:shadow-md outline-none focus:outline-none  ease-linear transition-all text-center duration-150">
        Print PDF
      </Button>
    </>
  )
}
